import React from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import Loginpage from './component/loginpage';

function App(){
  return(
    <Router>
      <Route path="/" exact component={Loginpage}/>
      </Router>
  )
}
export default App;
